import React, { Component } from "react";
import { MDBDataTable } from "mdbreact";

const TableBody = (props) => {
  if (props.response == null) {
    const rows = (
      <tr key={1}>
        <td>No values are input yet!</td>
      </tr>
    );
    return <tbody>{rows}</tbody>;
  } else {
    const rows = props.response.nedbetalingsplan.innbetalinger.map(
      (row, index) => {
        return (
          {
            dato: row.dato,
            innbetaling: Math.round(row.innbetaling) + "  NOK",
            gebyr: Math.round(row.gebyr) + "  NOK",
            renter: Math.round(row.renter) + "  NOK",
            restgjeld: Math.round(row.restgjeld) + "  NOK",
            total: Math.round(row.total) + "  NOK"
          }
        );
      }
    );
    console.log(rows)
    return rows
  }
};

class Table3 extends Component {
  render() {
    const { response } = this.props;
    const data = {
      columns: [
        {
          label: "Dato",
          field: "dato",
          sort: "asc",
          width: 150,
        },
        {
          label: "Innbetaling",
          field: "innbetaling",
          sort: "asc",
          width: 270,
        },
        {
          label: "Gebyr",
          field: "gebyr",
          sort: "asc",
          width: 200,
        },
        {
          label: "Renter",
          field: "renter",
          sort: "asc",
          width: 100,
        },
        {
          label: "Restgjeld",
          field: "restgjeld",
          sort: "asc",
          width: 150,
        },
        {
          label: "Terminkostnad",
          field: "total",
          sort: "asc",
          width: 100,
        },
      ],
      rows: [
        <TableBody response={response} />
      ],
    };

    return (
      <div>
        <MDBDataTable
          striped
          bordered
          hover
          data={data}
        />
      </div>
    );
  }
}


export default Table3;
